import { ListItemButton, MenuList } from '@mui/material'
import React from 'react'

type Props = {}

const chapitresManagement = (props: Props) => {
  return (
    <div className='flex verth-28 w-fit '>
      <div className='w-fit m-5' > ChapitreID</div>
      <div className='w-fit m-5' > Nom</div>
      <div className='w-fit m-5' >
        <ListItemButton>Chapitres</ListItemButton>
      </div>
      <div className='w-fit m-5' > PRODUCT</div>
    </div>
  )
}

export default chapitresManagement
